import AllureReporter from '@wdio/allure-reporter';
import { expect } from 'chai';
import { datosUser } from '../Datos/datosRegister.json';
import HomePage from '../pages/home.page';
import LoginPage from '../pages/login.page';

describe('Madison Island', () => {
  before('Deberia ingresar a la pagina Madison Island', async () => {
    await HomePage.open('/');
  });
  it('Debería redirigirse a Register, ingresar los datos del usuario y registrarse', async () => {
    AllureReporter.addStep(
      'Se cliquea el desplegable Account y luego la opción Register'
    );
    await HomePage.account.click();
    await HomePage.register.click();

    AllureReporter.addStep(
      'Se completa el formulario con datos del usuario y se registra'
    );
    expect(await LoginPage.titleRegister.getText(), 'Create an Account');
    await LoginPage.namee.setValue(datosUser.firstName);
    await LoginPage.lastname.setValue(datosUser.lastName);
    await LoginPage.mail.setValue(datosUser.email);
    await LoginPage.password.setValue(datosUser.password);
    await LoginPage.passConfirm.setValue(datosUser.password);
    await LoginPage.buttonRegister.keys('Enter');
    expect(await LoginPage.registerComplete.getText(), 'My Dashboard');
  });
  it('Deberia des-loguearse', async () => {
    AllureReporter.addStep('Se desloguea de la pagina');
    await HomePage.account.click();
    await HomePage.logout.click();
    expect(await LoginPage.logoutComplete.getText(), 'You are now logged out');
  });
});

